import React from "react";
// import Data from "./Data";
// import data from "../data.json";

function Card( {title, data} ) {
    return(

        <div>

            {data[0].map}

            <div className="card">

                <p>{title}</p>

            </div>
        </div>

    );
}

export default Card;
